import bossPackage from '../../../../../package.json'

const BOSS_VERSION = bossPackage?.version || '0.0.0'

const withBossVersion = value =>
    typeof value === 'string' ? value.replaceAll('__BOSS_VERSION__', BOSS_VERSION) : ''

